import axios from 'axios'
import {LoginBody, LoginResponse} from "../interfaces/login.ts";

const api = axios.create({
    baseURL: 'http://127.0.0.1:8000/',
});

export const login = async (loginData: LoginBody) => {
    try {
        const response:LoginResponse = await api.post('/rest/v1/login/', loginData);
        return response;
    } catch (error) {
        console.log(error);
        throw error;
    }
};
